import React from 'react';
import './App.css';
import Home from './components/Home';
import { BrowserRouter, Route, Routes } from 'react-router-dom';
import NormalCar from './components/NormalCar';
import { SportyCar } from './components/SportyCar';
import { LuxeCar } from './components/LuxeCar';
import Truck from './components/Truck';

function App() {

  const AbstractEngine = [
    {
    id: 1,
    EngineType: "Benzine"
  },
  {
    id: 2,
    EngineType: "Gas"
  }
]
const AbstractCarColor = [
  {
    id: 1,
    color:"Wit"
  },
  {
    id: 2,
    color:"Zwart"
  },
  {
    id: 2,
    color:"Blauw"
  }
]
  const AbstractDoor = [
    {
      id: 1,
      color:"Wit"
    },
    {
      id: 2,
      color:"Zwart"
    },
    {
      id: 2,
      color:"Blauw"
    }
]
  const AbstractWindow = [
    {
    id: 1,
    color:"Transparant"
  },
  {
    id: 2,
    color:"Gedimd"
  }
]
  const AbstractTire = [
    {
    id: 1,
    color:"Zwart",
    BrandName: "Michelin",
  },
  {
    id: 2,
    color:"Zwart",
    BrandName: "Continental",
    TireSmoke: "Red"
  }
]
  const AbstractRim = [
    {
    id: 1,
    color: "Chrome",
  },
  {
    id: 2,
    color: "Staal",
  }
]
const SportyCarSpoiler = [
  {
    id: 1,
    color: "Rood"
  },
  {
    id: 2,
    color: "Blauw"
  },
  {
    id: 1,
    color: "Wit"
  },
]
const SportyCarTireSmoke = [
  {
    id: 1,
    color: "Rood"
  },
  {
    id: 2,
    color: "Blauw"
  },
  {
    id: 1,
    color: "Wit"
  },
]
const SportyCarRollcage = [
  {
    id: 1,
    color: "Roze"
  },
  {
    id: 2,
    color: "Rood"
  },
  {
    id: 3,
    color: "Zwart"
  }
]

  return (
    <div className="App">
      <BrowserRouter>
          <Routes>
              <Route path='/' element={<Home/>}/>
                  <Route 
                  path='/normale-auto'
                   element=
                   {
                   <NormalCar
                    engine={AbstractEngine}
                    doors={AbstractDoor}
                    windows={AbstractWindow}
                    tires={AbstractTire}
                    rims={AbstractRim}
                    color={AbstractCarColor}
                   />
                   }/>    
                   <Route 
                  path='/sporty-auto'
                   element=
                   {
                   <SportyCar
                    engine={AbstractEngine}
                    doors={AbstractDoor}
                    windows={AbstractWindow}
                    tires={AbstractTire}
                    rims={AbstractRim}
                    color={AbstractCarColor}
                    tiresmoke = {SportyCarTireSmoke}
                    rollcage = {SportyCarRollcage}
                    spoiler = {SportyCarSpoiler}
                    hasSportsmode
                   />
                   }/>    
                <Route 
                  path='/chauffeur-auto'
                   element=
                   {
                   <LuxeCar
                   engine={AbstractEngine}
                   doors={AbstractDoor}
                   windows={AbstractWindow}
                   tires={AbstractTire}
                   rims={AbstractRim}
                   color={AbstractCarColor}
                   />
                   }/>   
                    <Route 
                  path='/truck'
                   element=
                   {
                   <Truck
                   engine={AbstractEngine}
                   doors={AbstractDoor}
                   windows={AbstractWindow}
                   tires={AbstractTire}
                   rims={AbstractRim}
                   color={AbstractCarColor}
                   />
                   }/>   
            </Routes>
      </BrowserRouter>
    </div>
  );
}

export default App;
